
/**添加银行行联号信息序列*/
CREATE SEQUENCE SEQ_PARTNER_BANK_INFO;

 

/** 银行行联号信息*/
CREATE TABLE BIZ_PARTNER_BANK_INFO
(
  PID 	INTEGER  PRIMARY KEY,
  BANK_NO            VARCHAR2(21) NOT NULL,
  BANK_NAME          VARCHAR2(300),
  REMIT_TYPE        VARCHAR2(6),
  BANK_TYPE         VARCHAR2(4),
  UNION_STATUS      VARCHAR2(6),
  STATION_NO        VARCHAR2(13),
  CLEAR_BANK_NO     VARCHAR2(21),
  NODE_CODE         VARCHAR2(5),
  UP_BANK_NO        VARCHAR2(1100),
  PBC_BANK_NO       VARCHAR2(21),
  CITY_CODE         VARCHAR2(32),
  UNION_BANK_NAME_S VARCHAR2(61),
  UPDATE_TERM       VARCHAR2(9),
  AMT               VARCHAR2(21),
  PROVINCE_NAME     VARCHAR2(33),
  CITY_NAME         VARCHAR2(33),
  BANK_PHONE        VARCHAR2(100),
  BANK_ADDR         VARCHAR2(256),
  RESERV_NUM1       VARCHAR2(11),
  RESERV_STR1       VARCHAR2(65),
  START_DATE        VARCHAR2(31),
  DUE_DATE          VARCHAR2(31),
  USE_TERM          VARCHAR2(9),
  LAST_MOD_DATE     VARCHAR2(31),
  ZIPCODE           VARCHAR2(32),
  EMAIL             VARCHAR2(100),
  REMARK            VARCHAR2(32)
);
 
/** 银行行联号信息备注 */
COMMENT ON COLUMN BIZ_PARTNER_BANK_INFO.PID  IS '参数标识';
COMMENT ON COLUMN BIZ_PARTNER_BANK_INFO.BANK_NO  IS '联行行号';
COMMENT ON COLUMN BIZ_PARTNER_BANK_INFO.BANK_NAME  IS '联行行名';
COMMENT ON COLUMN BIZ_PARTNER_BANK_INFO.REMIT_TYPE  IS '汇划种类';
COMMENT ON COLUMN BIZ_PARTNER_BANK_INFO.BANK_TYPE  IS '行别代码';
COMMENT ON COLUMN BIZ_PARTNER_BANK_INFO.UNION_STATUS  IS '联行状态';
COMMENT ON COLUMN BIZ_PARTNER_BANK_INFO.STATION_NO  IS '小站号';
COMMENT ON COLUMN BIZ_PARTNER_BANK_INFO.CLEAR_BANK_NO  IS '资金清算行代号';
COMMENT ON COLUMN BIZ_PARTNER_BANK_INFO.NODE_CODE  IS '节点代码';
COMMENT ON COLUMN BIZ_PARTNER_BANK_INFO.UP_BANK_NO  IS '本行上级参与者';
COMMENT ON COLUMN BIZ_PARTNER_BANK_INFO.PBC_BANK_NO  IS '所属人行代码';
COMMENT ON COLUMN BIZ_PARTNER_BANK_INFO.CITY_CODE  IS '所在城市代码';
COMMENT ON COLUMN BIZ_PARTNER_BANK_INFO.UNION_BANK_NAME_S  IS '联行行名简称';
COMMENT ON COLUMN BIZ_PARTNER_BANK_INFO.UPDATE_TERM  IS '更新期数';
COMMENT ON COLUMN BIZ_PARTNER_BANK_INFO.AMT  IS '金额';
COMMENT ON COLUMN BIZ_PARTNER_BANK_INFO.PROVINCE_NAME  IS '所在省份名';
COMMENT ON COLUMN BIZ_PARTNER_BANK_INFO.CITY_NAME  IS '所在城市名';
COMMENT ON COLUMN BIZ_PARTNER_BANK_INFO.BANK_PHONE  IS '联系电话';
COMMENT ON COLUMN BIZ_PARTNER_BANK_INFO.BANK_ADDR  IS '联系地址';
COMMENT ON COLUMN BIZ_PARTNER_BANK_INFO.RESERV_NUM1  IS '保留字段1';
COMMENT ON COLUMN BIZ_PARTNER_BANK_INFO.RESERV_STR1  IS '保留字段2';
COMMENT ON COLUMN BIZ_PARTNER_BANK_INFO.START_DATE  IS '起用日期';
COMMENT ON COLUMN BIZ_PARTNER_BANK_INFO.DUE_DATE  IS '到期日期';
COMMENT ON COLUMN BIZ_PARTNER_BANK_INFO.USE_TERM  IS '使用期限';
COMMENT ON COLUMN BIZ_PARTNER_BANK_INFO.LAST_MOD_DATE  IS '最后变动日期';

 
/**添加唯一约束*/
ALTER TABLE BIZ_PARTNER_BANK_INFO ADD CONSTRAINT  UIDX_BIZ_PARTNER_BANK_INFO
     UNIQUE (BANK_NO,CITY_CODE,BANK_TYPE);
 
 
 
 
